import React from "react";
import { Container, Flex } from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";

const SignInOut = () => {
  return (
    <Container p="10rem" mh="100vh" bgColor="#e0f7fa" h="60%">
      <Flex bgColor="#f3e5f5" mh="60vh">
        <SignUpImage>...</SignUpImage>
      </Flex>
    </Container>
  );
};

export default SignInOut;
